
/**
 * This is utility static class used for logging.
 * 
* ```ts
* Debug.Log("I am a log!");
* ```
 * 
 */
export class Debug  {
    /**
     * Displays a log in the console.
    * ```ts
    * Debug.Log("I am a log!");
    * ```
     * @param message - The message to be displayed in the console.
     */
    public static Log(message: string): void;
}
